// Uses the global database handle.
func (o *Rower) RemoveRentalRowersG(related ...*RentalRower) error {
	return o.RemoveRentalRowers(boil.GetDB(), related...)
}

// RemoveRentalRowers relationships from objects passed in.
// Removes related items from R.RentalRowers (uses pointer comparison, removal does not keep order)
// Sets related.R.Rower.
func (o *Rower) RemoveRentalRowers(exec boil.Executor, related ...*RentalRower) error {
	var err error
	for _, rel := range related {
		queries.SetScanner(&rel.RowerID, nil)
		if rel.R != nil {
			rel.R.Rower = nil
		}
		if _, err = rel.Update(exec, boil.Whitelist("rower_id")); err != nil {
			return err
		}
	}
	if o.R == nil {
		return nil
	}

	for _, rel := range related {
		for i, ri := range o.R.RentalRowers {
			if rel != ri {
				continue
			}

			ln := len(o.R.RentalRowers)
			if ln > 1 && i < ln-1 {
				o.R.RentalRowers[i] = o.R.RentalRowers[ln-1]
			}
			o.R.RentalRowers = o.R.RentalRowers[:ln-1]
			break
		}
	}

	return nil
}

