// FindRower retrieves a single record by ID with an executor.
// If selectCols is empty Find will return all columns.
func FindRower(exec boil.Executor, iD int, selectCols ...string) (*Rower, error) {
	rowerObj := &Rower{}

	sel := "*"
	if len(selectCols) > 0 {
		sel = strings.Join(strmangle.IdentQuoteSlice(dialect.LQ, dialect.RQ, selectCols), ",")
	}
	query := fmt.Sprintf(
		"select %s from \"rower\" where \"id\"=$1", sel,
	)

	q := queries.Raw(query, iD)

	err := q.Bind(nil, exec, rowerObj)
	if err != nil {
		if errors.Cause(err) == sql.ErrNoRows {
			return nil, sql.ErrNoRows
		}
		return nil, errors.Wrap(err, "models: unable to select from rower")
	}

	return rowerObj, nil
}

